import * as types from './types';

export const incrementNumberOfRequestsMade = () => ({
    type: types.INCREMENT_NUMBER_OF_REQUESTS_MADE
});

export const getWeatherData = (city) => ({
    type: types.INCREMENT_NUMBER_OF_REQUESTS_MADE,
    payload: city
});
